import java.util.Arrays;

public class DayFive {

    private char[] alphabet = "abcdefghijklmnopqrstuvwxyz".toCharArray();

    public int getReactionResult(String input) {
        char[] values = input.toCharArray();
        for(int i = 0; i + 1 < input.length(); i++) {
            if(String.valueOf(input.charAt(i)).equalsIgnoreCase(String.valueOf(input.charAt(i + 1)))) {
                if (checkPolaritiesOpposite(input.charAt(i), input.charAt(i + 1))) {
                    input = input.replace(String.valueOf(input.charAt(i)) + String.valueOf(input.charAt(i + 1)), "");
                    values = input.toCharArray();
                    i = -1;
                }
            }
        }
        return values.length;
    }

    public int getShortestSingleCollapse(String input) {
        int smallestLength = Integer.MAX_VALUE;
        for(char c : alphabet) {
            String copy = input;
            copy = copy.replace(String.valueOf(c), "").replace(String.valueOf(c).toUpperCase(), "");
            int reactionResult = getReactionResult(copy);
            if(reactionResult < smallestLength) {
                smallestLength = reactionResult;
            }
        }
        return smallestLength;
    }

    private boolean checkPolaritiesOpposite(char firstChar, char secondChar) {
        if(Character.isLowerCase(secondChar) && Character.isUpperCase(firstChar)) {
                return true;
        } else if(Character.isLowerCase(firstChar) && Character.isUpperCase(secondChar)) {
            return true;
        }
        return false;
    }

    public static void main(String[] args) {
        DayFive dayFive = new DayFive();
        System.out.println(dayFive.getReactionResult(input));
        System.out.println(dayFive.getShortestSingleCollapse(input));
    }

    private static final String input = "";
}
